import Card from "./Card";

const Mid = ()=>{
    const cardData = [
        {
            title:'Leetcode',
            class:'card1',
            sub_title:'leetcode',
            count:'340',
            rank:'49+',
            comp_percent:'80%'
        },
        {
            title:'CodeForces',
            class:'card2',
            sub_title:'leetcode',
            count:'340',
            rank:'49+',
            comp_percent:'56%'
        },
        {
            title:'CodeForces',
            class:'card3',
            sub_title:'leetcode',
            count:'340',
            rank:'49+',
            comp_percent:'70%'
        }
    ]
    return(
        <section className="mid-top mt-[1rem]">
            <div className="mid-left">
                <div className="cards">
                    {
                        cardData.map((card,index)=>{
                            return(
                                <Card props={card}/>
                            );
                        })
                    }
                </div>
            </div>
            <div className="mid-right">

            </div>
        </section>
    )

}

export default Mid;
